Bitter Kas Aperitiv Limonade Bitter Kas ist ein fast ausschließlich in Spanien populäres alkoholfreies Erfrischungsgetränk. Es hat weniger Kohlensäure als andere Erfrischungsgetränke und hat einen speziellen, bitter-süßen Geschmack.


&nbsp;


Bitter Kas schmeckt hervorragend als Aperitiv, am Besten eisgekühlt, serviert mit Eiswürfeln und einer Zitronenscheibe an heißen Sommertagen.Das Unternehmen Kas wurde 1956 von den Gebrüdern Román und José María Knörr gegründet, zwei Nachfahren eines in Vitoria ansässigen deutschen Bierbrauers, die zuerst Limonaden herstellten und verkauften. Seit 1992 gehört Kas zur PepsiCo.
